import React, {useState} from 'react';
import { Button, Flex, Tooltip } from 'antd';
import { PlusOutlined } from '@ant-design/icons';
import '../dashboard.css';

export const Assetsformfilter =() =>{
    const [asset, setAsset] = useState('');
    const [type, setType] = useState('');
    const [serial_no, setSerial_no] = useState('');
    const [model, setModel] = useState('');
    const [os, setOS] = useState('');
    const [vendor, setVendor] = useState('');
    const [address, setAddress] = useState('');
    const [number, setNumber] = useState('');

    return(



        <div>
        <form class="modal-content">


            <p>Asset Information</p>


            <div className="input_text">
            <input value ={asset} onChange={(e) =>setAsset(e.target.value)}  type="asset" placeholder="asset" id="asset" name="asset"
            className="asset"/> 
            </div>

            <div className="input_text">
            <input value ={type} onChange={(e) =>setType(e.target.value)}  type="Type" placeholder="type" id="type" name="type"
            className="type"/> 
            </div>

            <div className="input_text">
            <input value ={serial_no} onChange={(e) =>setSerial_no(e.target.value)}  type="serial_no" placeholder="serial_no" id="serial_no" name="serial_no"
            className="serial_no"/> 
            </div>

            <div className="input_text">
            <input value ={model} onChange={(e) =>setModel(e.target.value)}  type="model" placeholder="model" id="model" name="model"
            className="model"/> 
            </div>

            <div className="input_text">
            <input value ={os} onChange={(e) =>setOS(e.target.value)}  type="os" placeholder="os" id="os" name="os"
            className="os"/> 
            </div>

            <p>Vendor Information</p>


            <div className="input_text">
            <input value ={vendor} onChange={(e) =>setVendor(e.target.value)}  type="vendor" placeholder="vendor" id="vendor" name="vendor"
            className="vendor"/> 
            </div>

            <div className="input_text">
            <input value ={address} onChange={(e) =>setAddress(e.target.value)}  type="address" placeholder="address" id="address" name="address"
            className="address"/> 
            </div>

            <div className="input_text">
            <input value ={number} onChange={(e) =>setNumber(e.target.value)}  type="number" placeholder="number" id="number" name="number"
            className="number"/> 
            </div>
